import React, {useState, useEffect} from 'react'

const HomePage = () => {
  let [notes, setNotes] = useState([])
  return (
    <div>
        <p>You are logged in to the home page!</p>    


        <ul>
          {notes.map(note => (
            <li key={note.id}>{note.body}</li>
          ))}
        </ul>
    </div>
  )
}

export default HomePage
